// Importing the React library to use React components and features
import React from 'react';

import ReactDOM from 'react-dom';

// Importing BrowserRouter from react-router-dom for enabling routing in the app
import { BrowserRouter } from 'react-router-dom';

// Importing the main App component, which serves as the root component of the application
import App from './App';

// Importing createRoot from react-dom/client for rendering React components in React 18+
import { createRoot } from 'react-dom/client';

// Selecting the root DOM element where the React app will be mounted
const container = document.getElementById('root');

// Creating a root object using React 18's createRoot API
const root = createRoot(container);

// Rendering the App component into the root using React 18's createRoot API
root.render(<App />);

// Attempting to render the App component wrapped in BrowserRouter using ReactDOM.render (React 17 and earlier API)
ReactDOM.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>,
    document.getElementById('root')
);
